def predict(triples: list[Triple]) -> str:
    """
    Generates a natural language sentence from a list of triples.
    """
    if not triples:
        return ""

    sentence = ""
    subject = triples[0].subject
    clauses = []

    for i, triple in enumerate(triples):
        if triple.predicate == "city" and i == 0:
            sentence += f"{subject} is a city "
        elif triple.predicate == "country" and i == 1 and "city" in triples[0].predicate:
            sentence += f"in {triple.object}. "
        elif triple.predicate == "capital" and i > 0 and "country" in [t.predicate for t in triples[:i]]:
            sentence += f"Its capital is {triple.object}. "
        elif triple.predicate == "established" and i == 0:
            sentence += f"{subject} was established in "
        elif triple.predicate == "location" and i == 1 and "established" in [t.predicate for t in triples[:i]]:
            sentence += f"{triple.object}. "
        elif triple.predicate == "numberOfStudents" and i > 0:
            sentence += f"It has {triple.object} students. "
        else:
            sentence += f"{triple.subject} {triple.predicate} {triple.object}. "

    return sentence.strip()

